import React from 'react';
import { NewsProvider } from '../NewsContext';
import NewsComponent from './NewsComponent';

export default function News({ teamName }) {
  const query = `${teamName} Cricket Team`;

  return (
    <NewsProvider query={query}>
      <NewsComponent />
    </NewsProvider>
  );
}
